import React from 'react';
import './App.css';
//import $ from 'jquery';

const App = () => {
  return (
    <article className="App">
      <Header>
      </Header>
    </article>
  );
}

const Header = () => {
  const joukkue = "Huutoniemen Hoki";
  const lyhenne = "HH";
  return (
      <header className="App-header">
        <p>{lyhenne}</p>
        <h1>{joukkue}</h1>
      </header>
  );
}

export default App;
